import React from 'react'
import styled from 'styled-components'

const StyledLI = styled.li`
    display: flex;
    background-color: white;
    width: 100%;
    padding: 5px;
    align-items: center;
    height: 20px;    
`

const LIText = styled.p`
    font-weight: 400;
    font-size: 1.0em;
    width: 85%;
`

const Item = (props) => {
    return(
        <StyledLI>
            <i className={props.icon}></i>
            <LIText>{props.text}</LIText>
        </StyledLI>
    )
}

export default Item
